import React from 'react';

// استایل‌ها
const styles = {
  // کدهای استایل اینجا قرار می‌گیرن (همون‌هایی که بالا نوشتم)
};

// کامپوننت اصلی
function App() {
  return (
    <div style={styles.loginContainer}>
      {/* Group 2 */}
      <div style={styles.group2}>
        {/* Rectangle 5 */}
        <div style={styles.rectangle5}></div>

        {/* Group 3 */}
        <div style={styles.group3}>
          {/* دکمه LOG IN */}
          <div style={styles.loginButton}>
            <div style={styles.rectangle8}></div>
            <div style={styles.loginText}>LOG IN</div>
          </div>

          {/* فیلد password */}
          <div style={styles.password}>
            <div style={styles.rectangle7}></div>
            <div style={styles.passwordText}>password</div>
          </div>

          {/* فیلد username */}
          <div style={styles.username}>
            <div style={styles.rectangle6}></div>
            <div style={styles.usernameText}>username</div>
          </div>
        </div>

        {/* Group 4 */}
        <div style={styles.group4}>
          <div style={styles.forgotPassword}>Forgot password?</div>
        </div>

        {/* Group 5 */}
        <div style={styles.group5}>
          <div style={styles.noAccount}>No account?</div>
          <div style={styles.createOne}>Create one</div>
        </div>
      </div>

      {/* آیکون home */}
      <div style={styles.homeIcon}></div>

      {/* آیکون bars */}
      <div style={styles.bars}>
        <div style={styles.vector}></div>
      </div>
    </div>
  );
}

export default App;
